package csv;

public class Parkingdetails {
	public Parkingdetails() {
	}
		// TODO Auto-generated method stub
	    private String amount;
	    private String camera_capture;
	    private String check_in_time ;
	    private String check_out_time;
	    private String MobileNum;
	    private String VehicleNum;
	    private String VehicleType;
	    private String operator_checkin_Name;
	    private String operator_checkout_Name;
	    private String parked_hours;
	    
		public String getamount() {
			return amount;
		}
		public void setamount(String amount) {
			this.amount = amount;
		}
		public String getcamera_capture() {
			return camera_capture;
		}
		public void setcamera_capture(String camera_capture) {
			this.camera_capture = camera_capture;
		}
		public String getcheck_in_time() {
			return check_in_time;
		}
		public void setcheck_in_time(String check_in_time) {
			this.check_in_time = check_in_time;
		}
		public String getcheck_out_time() {
			return check_out_time;
		}
		public void setcheck_out_time(String check_out_time) {
			this.check_out_time = check_out_time;
		}
		public String getMobileNum() {
			return MobileNum;
		}
		public void setMobileNum(String MobileNum) {	
			this.MobileNum = MobileNum;
		}
		public String getVehicleNum() {
			return VehicleNum;
		}
		public void setVehicleNum(String VehicleNum) {
			this.VehicleNum = VehicleNum;
		}
		public String getVehicleType() {
			return VehicleType;
		}
		public void setVehicleType(String VehicleType) {
			this.VehicleType = VehicleType;
		}
		public String getoperator_checkin_Name() {
			return operator_checkin_Name;
		}
		public void setoperator_checkin_Name(String operator_checkin_Name) {
			this.operator_checkin_Name = operator_checkin_Name;
		}

		public String getoperator_checkout_Name() {
			return operator_checkout_Name;
		}
		public void setoperator_checkout_Name(String operator_checkout_Name) {
			this.operator_checkout_Name = operator_checkout_Name;
		}
		public String getparked_hours() {
			return parked_hours;
		}
		public void setparked_hours(String parked_hours) {
			this.parked_hours = parked_hours;
		}

}
	    
	
	    
	
	    
	    
	


